{\rtf1\ansi\ansicpg1252{\fonttbl{\f0}}\fs20\pard\f0 If \b Selected\b0 , personal data will be included in the cleanup process. \par
If \b Cleared\b0 , personal data will never be affected.\f0\par
}

{\rtf1\ansi\ansicpg1252{\fonttbl{\f0}}\fs20\pard\f0 The anonymization method used when data is anonymized. If not specified, the default anonymization method or fixed anonymization will be used.\par
\b Note:\b0  The fixed anonymization value can be set in the \b\i Personal Data Anonymization Detail\b0\i0  window (available by right-clicking \b Customize Anonymization\'85\b0 ). Fixed anonymization method works \b only\b0  for anonymization (not removal).\par
}
